              locales: [
                { locale: zhCN.locale, placeholder: "\u8BF7\u5728\u8FD9\u91CC\u8F93\u5165\u5466 (#^.^#)" },
                {
                  locale: enUS.locale,
                  placeholder: "please enter here (#^.^#)",
                },
              ],
              // \u5F53\u524D\u9009\u62E9\u7684\u8BED\u8A00
